function basicTable(idTable, data, columns, datafields) {


    var source = {
        localdata: data,
        datafields: datafields,
        datatype: "json"
    };

    var dataAdapter = new $.jqx.dataAdapter(source);

    $("#" + idTable).jqxGrid({
        width: '100%',
        source: dataAdapter,
        theme: getTema(),
        showfilterrow: true,
        filterable: true,
        pageable: true,
        columns: columns,
        sortable: true
    });
}


