function crearSwesher(campo) {
    var switchOptions = {},
        switchColors = {
            'orange': '#F89B03',
            'purple': '#AB7DF6',
            'yellow': '#F3BB23',
            'red': '#ff4402',
            'blue': '#45AEEF'
        }

    if (campo.data("size")) switchOptions.size = campo.data("size");
    var color = campo.data("color");
    if (switchColors[color] !== undefined) {
        switchOptions.color = switchColors[color];
    } else {
        switchOptions.color = color;
    }
    var switchery = new Switchery(campo, switchOptions);
}

function llenarFrmJson(frm, json) {
    for (let key in json) {
        if (json.hasOwnProperty(key)) {
            let type = $('#' + key).attr("type");
            if (type === "checkbox") {
                $('#' + key).prop("checked", json[key]);
            } else if (type === "text" || type === "password") {
                $('#' + key).val(json[key]);
            } else {
                $('#' + key).val(json[key]);
            }
        }
    }
}
const _currency = value => currency(String(value).replace(",",""), {  symbol: '' });
function solo_numero_focus(campo) {
    $("#" + campo).keydown(function (e) {
        // Allow: backspace, delete, tab, escape, enter and .
        if ($.inArray(e.keyCode, [46, 8, 9, 27, 13, 110, 190]) !== -1 ||
            // Allow: Ctrl+A
            (e.keyCode == 65 && e.ctrlKey === true) ||
            // Allow: Ctrl+C
            (e.keyCode == 67 && e.ctrlKey === true) ||
            // Allow: Ctrl+X
            (e.keyCode == 88 && e.ctrlKey === true) ||
            // Allow: home, end, left, right
            (e.keyCode >= 35 && e.keyCode <= 39)) {
            // let it happen, don't do anything
            return;
        }
        // Ensure that it is a number and stop the keypress
        if ((e.shiftKey || (e.keyCode < 48 || e.keyCode > 57)) && (e.keyCode < 96 || e.keyCode > 105)) {
            e.preventDefault();
        }
    });
    $("#" + campo).focus(function (e) {
        if (e.target.value !== "") {
            $(e.target).val(_currency(e.target.value));
            $(e.target).select();
        }
    });
    $("#" + campo).focusout(function (e) {
        if (e.target.value !== "") {
            $(e.target).val(_currency(e.target.value).format());
        }
    });
}

